import React  from 'react'
import emailjs from 'emailjs-com'

function SecondModal ({closeSecondModal}){

  function sendEmail2(e){
    e.preventDefault();

    emailjs.sendForm('service_5oz0ah6', 'template_dwz5ur5', e.target, 'MCvP1ezzKhPrMxeQl')
      .then((result)=>{
        console.log(result.text);
      }, (error)=>{
        console.log(error.text);
      });
      e.target.reset()
  }

  return (
    
    <div className='row justify-content-center'>
        {/* <button onClick={() => closeModal(false)}> X </button> */}
      <div className='raman-title'>
        <h2>Don't worry. You can still virtually celebrate with us!</h2>
        <div className='col-md-12'>
       
            <div className='col-md-12'>
                <p>Zoom Link</p>
            </div>

            
            <div className='col-md-12'>
                <div className='form-group'>
                  <textarea
                    name='message'
                    id='message'
                    cols='30'
                    rows='7'
                    className='form-control'
                    placeholder='Message'
                    required
                  ></textarea>
                </div>
              </div>

            <div className='footer'>
            </div>
        
          
            
          </div>
        </div>
      </div>
    
  )
}

export default SecondModal
